CREATE TABLE IF NOT EXISTS `wordpress`.`wp_actionscheduler_actions`(
    `action_id` bigint unsigned NOT NULL AUTO_INCREMENT,
    `hook` varchar(191) NOT NULL,
    `status` varchar(20) NOT NULL,
    `scheduled_date_gmt` datetime NULL DEFAULT '1970-01-01 00:00:00',
    `scheduled_date_local` datetime NULL DEFAULT '1970-01-01 00:00:00',
    `priority` tinyint unsigned NOT NULL DEFAULT '10',
    `args` varchar(191) NULL,
    `schedule` longtext NULL,
    `group_id` bigint unsigned NOT NULL DEFAULT '0',
    `attempts` int NOT NULL DEFAULT '0',
    `last_attempt_gmt` datetime NULL DEFAULT '1970-01-01 00:00:00',
    `last_attempt_local` datetime NULL DEFAULT '1970-01-01 00:00:00',
    `claim_id` bigint unsigned NOT NULL DEFAULT '0',
    `extended_args` varchar(8000) NULL,
    PRIMARY KEY  (`action_id` ),
    KEY `hook_status_scheduled_date_gmt` (`hook`(217) ,`status` ,`scheduled_date_gmt` ),
    KEY `status_scheduled_date_gmt` (`status` ,`scheduled_date_gmt` ),
    KEY `scheduled_date_gmt` (`scheduled_date_gmt` ),
    KEY `args` (`args` ),
    KEY `group_id` (`group_id` ),
    KEY `last_attempt_gmt` (`last_attempt_gmt` ),
    KEY `claim_id_status_scheduled_date_gmt` (`claim_id` ,`status` ,`scheduled_date_gmt` )
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_520_ci ;

